import execjs


def exec_js(data):
    with open('./webDES.js', 'r', encoding='utf-8') as f:
        js = f.read()

    resp = execjs.compile(js)

    response = resp.call('webInstace.shell', data)
    print(response)


if __name__ == '__main__':
    data = """"""
    exec_js(data)
